import React from 'react'


export default function ShowcaseResult(props) {
    console.log(props)   

    return (
        <div
        style={{border: `1px solid black`,
                borderRadius: `13px`,
                fontWeight: `400`,
                fontStyle: `normal`,
                padding: `.5em`,
                margin: `.4em auto .4em auto`
                }}
        >

             <p>{props.result.text}</p> 

            <img
                src={props.result.url ?  props.result.url : ''}
                width='100%'
                style={props.result.type ? {borderRadius: `13px`} : {borderRadius: `none`}}
            >
            </img>  

            {props.result.type === 'photo' ? <Image /> : <Video/> }

        </div>
    )
}
